export class AnchorElement extends HTMLAnchorElement {
    _rlink = "";
    constructor(optional) {
        super();
        Component.applyData(optional, this);
        this.addEventListener("click", (event) => {
            event.preventDefault();
            if (this._rlink != "") {
                Router.go(this._rlink);
            }
        });
        this.addEventListener("href", (event) => {
            if (this._rlink != "") {
                event.preventDefault();
                Router.go(this._rlink);
            }
        });
    }
    set rlink(link) {
        this.href = link;
        this._rlink = link;
    }
    get rlink() {
        return this._rlink;
    }
}
